import Banner from '../../components/Banner/Banner';
import Categories from '../../components/Categories/Categories';
import NewProduct from '../../components/NewProduct/NewProduct';

import Slide from '../../components/slide/Slide';
import Slogan from '.././layout/Slogan/Slogan'
import Navigation from '../layout/Navigation/Navigation'

import './Home.scss'
const Home = () => {
  return (
    <div>
       <div className='container background-slogan'>
       <Slogan/>
       </div>
       <div className='container'>
       <Navigation/>
       </div>
       <div><Slide/></div>
      <div><Banner/></div>
      <div className='section'>
      
      <div className='section__newitems'><NewProduct/></div>
      <div className="section__widgets">
         <div className="section__widgets__divider" ><span ></span></div>
      </div>
   
      </div>
      
     

    
    
    
    </div>
  )
}

export default Home
